//// An Oomtility Wrap of .gitignore \\//\\// https://oomtility.loop.coop ////
module.exports.writeGitignore = function (config, path) {
const encoding = rxBinaryExt.test(path) ? 'binary' : 'utf8'
const flag = 'a'
let out = ''
const write = str => out += null == path ? str
  : fs.writeFileSync(path, str, { encoding, flag })
write(''
  + '.DS_Store\n'
  + '*.log\n'
  + 'npm-debug.log.*\n'
  + 'node_modules/*\n'
  + ''
)
    return null == path ? out : null
}




